var initialState = [
    {
        id : 1,
        name : 'iPhone 6 Plus',
        image : '',
        description : "Here is product 666 newst of us",
        price : 500,
        inventory : 10
    },
    {
        id : 2,
        name : 'iPhone X',
        image : '',
        description : "Here is product XXX newst of us",
        price : 200,
        inventory : 50
    },
    {
        id : 3,
        name : 'iPhone 5S',
        image : '',
        description : "Here is product 5S newst of us",
        price : 350,
        inventory : 12
    },
]

const product = (state = initialState, action) => {    
    switch(action.type){
        default: 
            return [...state];
    }

}

export default product;
